import Header from './content/HeaderSection'
import Body from './content/BodyContent';
import { Box } from '@mui/material';

const inicio = () =>{
    return(
        <>
            <Box sx={{maxWidth:"1500px"}}>
                <Box sx={{display:'flex', flexDirection:"column", alignItems:"center", width}}>
                    <Header></Header>
                    <Body></Body>
                </Box>
            </Box>
        </>
    );
}

export default inicio;
